import React, { useState, useEffect } from "react";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import axios from "axios";

export default function BasicTable() {
  const [funcionarios, setFuncionarios] = useState([]);
  const api = "http://localhost:8080/api/funcionario/";

  useEffect(() => {
    axios.get(api).then((result) => {
      setFuncionarios(result.data);
    });
  }, []);

  return (
    <TableContainer component={Paper}>
      <Table sx={{ minWidth: 650 }} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Nome do funcionário</TableCell>
            <TableCell align="right">Função</TableCell>
            <TableCell align="right">Habilidades</TableCell>
            <TableCell align="right">Preferencias</TableCell>
            <TableCell align="right">Ações</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {funcionarios.map((funcionario) => (
            <TableRow
              key={funcionario.id}
              sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
            >
              <TableCell component="th" scope="row">
                {funcionario.nomeFuncionario}
              </TableCell>
              <TableCell align="right">{funcionario.funcao}</TableCell>
              <TableCell align="right">{funcionario.habilidades}</TableCell>
              <TableCell align="right">{funcionario.preferencias}</TableCell>
              <TableCell align="right"></TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
